const homeIcon = {
  scale: 2.3,
  uri: 'data:image/png;base64,'
}
const sampleIcon = {
  scale: 2.3,
  uri: 'data:image/png;base64,'
}
const recipeIcon = {
  scale: 2.3,
  uri: 'data:image/png;base64,'
}

const tabs = [
  { key: 'home', icon: homeIcon, title: 'Main' },
  { key: 'recipes', icon: recipeIcon, title: 'Recipes' },
  { key: 'samples', icon: sampleIcon, title: 'Samples' }
]

const initialState = {
  index: 0,
  routes: tabs
}

function tabsNav (state = initialState, action) {
  if (action.index === state.index) return state
  switch (action.type) {
    case CHANGE_TAB:
      return {
        ...state,
        index: action.index
      }
    default:
      return state
  }
}

export default tabsNav

